import classes from "./Admin.module.css";

export default function Act() {
  return (
    <div className={[classes.modal, classes.active].join(" ")}>
      <div className={classes.modalContent}>
        <h1>Test</h1>
        <h1>Test</h1>
        <h1>Test</h1>
      </div>
    </div>
  );
}
